import React from "react";
import { Button } from 'ui-neumorphism'

import "./Button.scss";

//icons

const Buttons = ({ children, link }) => {
  return (
    <Button className="btnComponent" style={{color:"green"}}>
      <a href={link}>{children}</a>
    </Button>
  );
};

export default Buttons;
